  const [isOpen, setIsOpen] = React.useState(false);
  const [selectedColor, setSelectedColor] = React.useState<ColorValue>(ColorValue.create({
    h: 0,
    s: 100,
    l: 50
  }));
  const formats = (['hsl', 'rgb', 'hex'] as const);
  const [currentFormat, setCurrentFormat] = React.useState<typeof formats[number]>(formats[0]);
